                <li><MenuButton ssylka="#" btntitle="Главная" /></li>
                <li><MenuButton ssylka="#" btntitle="Новости" /></li>
                <li><MenuButton ssylka="#" btntitle="Контакты" /></li>
                <li><MenuButton ssylka="#" btntitle="О нас" /></li>
            </header>
        )
    }
}

export default Header
